// Header.js

import React from 'react';

const Header = () => {
  return (
    <nav className="flex justify-between items-center mb-4">
      <a href="/">
        <img
          className="w-24 logo"
          src='images/logo.png'
                 alt="Logo"

        />
      </a>
      <ul className="flex space-x-6 mr-6 text-lg">
       <Navbar/>
      </ul>
    </nav>
  );
};

export default Header;
